@testset "5.3.6 Exponentials of inverse tangent" begin
    (a, b, c, m, n, p, x, ) = @variables a b c m n p x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n*atan(a*x))=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n*im*atan(a*x))=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [ℯ^(im*atan(a*x))*x^4, x, 6, -((4*im*x^2*sqrt(1 + a^2*x^2))/(15*a^3)) + (x^3*sqrt(1 + a^2*x^2))/(4*a^2) + (im*x^4*sqrt(1 + a^2*x^2))/(5*a) + ((64*im - 45*a*x)*sqrt(1 + a^2*x^2))/(120*a^5) + (3*asinh(a*x))/(8*a^5)]
    @test_int [ℯ^(im*atan(a*x))*x^3, x, 5, (x^2*sqrt(1 + a^2*x^2))/(3*a^2) + (im*x^3*sqrt(1 + a^2*x^2))/(4*a) - ((16 + 9*im*a*x)*sqrt(1 + a^2*x^2))/(24*a^4) + (3*im*asinh(a*x))/(8*a^4)]
    @test_int [ℯ^(im*atan(a*x))*x^2, x, 7, -((im*sqrt(1 + a^2*x^2))/a^3) + (x*sqrt(1 + a^2*x^2))/(2*a^2) + (im*(1 + a^2*x^2)^(3/2))/(3*a^3) - asinh(a*x)/(2*a^3)]
    @test_int [ℯ^(im*atan(a*x))*x^1, x, 3, ((2 + im*a*x)*sqrt(1 + a^2*x^2))/(2*a^2) - (im*asinh(a*x))/(2*a^2)]
    @test_int [ℯ^(im*atan(a*x))*x^0, x, 3, (im*sqrt(1 + a^2*x^2))/a + asinh(a*x)/a]
    @test_int [ℯ^(im*atan(a*x))/x^1, x, 6, im*asinh(a*x) - atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^(im*atan(a*x))/x^2, x, 5, -(sqrt(1 + a^2*x^2)/x) - im*a*atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^(im*atan(a*x))/x^3, x, 6, -(sqrt(1 + a^2*x^2)/(2*x^2)) - (im*a*sqrt(1 + a^2*x^2))/x + (1/2)*a^2*atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^(im*atan(a*x))/x^4, x, 7, -(sqrt(1 + a^2*x^2)/(3*x^3)) - (im*a*sqrt(1 + a^2*x^2))/(2*x^2) + (2*a^2*sqrt(1 + a^2*x^2))/(3*x) + (1/2)*im*a^3*atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^(im*atan(a*x))/x^5, x, 8, -(sqrt(1 + a^2*x^2)/(4*x^4)) - (im*a*sqrt(1 + a^2*x^2))/(3*x^3) + (3*a^2*sqrt(1 + a^2*x^2))/(8*x^2) + (2*im*a^3*sqrt(1 + a^2*x^2))/(3*x) - (3/8)*a^4*atanh(sqrt(1 + a^2*x^2))]


    @test_int [ℯ^((2*im)*atan(a*x))*x^3, x, 3, ((-2*im)*x)/a^3 + x^2/a^2 + (((2*im)/3)*x^3)/a - x^4/4 - (2*log(im + a*x))/a^4]
    @test_int [ℯ^((2*im)*atan(a*x))*x^2, x, 3, (2*x)/a^2 + (im*x^2)/a - x^3/3 - ((2*im)*log(im + a*x))/a^3]
    @test_int [ℯ^((2*im)*atan(a*x))*x^1, x, 3, ((2*im)*x)/a - x^2/2 + (2*log(im + a*x))/a^2]
    @test_int [ℯ^((2*im)*atan(a*x))*x^0, x, 3, -x + ((2*im)*log(im + a*x))/a]
    @test_int [ℯ^((2*im)*atan(a*x))/x^1, x, 3, log(x) - 2*log(im + a*x)]
    @test_int [ℯ^((2*im)*atan(a*x))/x^2, x, 3, -x^(-1) + (2*im)*a*log(x) - (2*im)*a*log(im + a*x)]
    @test_int [ℯ^((2*im)*atan(a*x))/x^3, x, 3, -1/(2*x^2) - ((2*im)*a)/x - 2*a^2*log(x) + 2*a^2*log(im + a*x)]
    @test_int [ℯ^((2*im)*atan(a*x))/x^4, x, 3, -1/(3*x^3) - (im*a)/x^2 + (2*a^2)/x - (2*im)*a^3*log(x) + (2*im)*a^3*log(im + a*x)]


    @test_int [ℯ^((3*im)*atan(a*x))*x^3, x, 14, (1 + im*a*x)^3/(a^4*sqrt(1 + a^2*x^2)) + (27*sqrt(1 + a^2*x^2))/(4*a^4) - (x^2*sqrt(1 + a^2*x^2))/a^2 - (im*x^3*sqrt(1 + a^2*x^2))/(4*a) - (9*im*(2*im - 3*a*x)*sqrt(1 + a^2*x^2))/(8*a^4) - (51*im*asinh(a*x))/(8*a^4)]
    @test_int [ℯ^((3*im)*atan(a*x))*x^2, x, 10, (im*(1 + im*a*x)^3)/(a^3*sqrt(1 + a^2*x^2)) + ((28*im - 3*a*x)*sqrt(1 + a^2*x^2))/(6*a^3) + (im*(3 + im*a*x)^2*sqrt(1 + a^2*x^2))/(3*a^3) + (11*asinh(a*x))/(2*a^3)]
    @test_int [ℯ^((3*im)*atan(a*x))*x^1, x, 9, -((9*sqrt(1 + a^2*x^2))/(2*a^2)) - (3*(1 + a^2*x^2)^(3/2))/(2*a^2*(1 - im*a*x)) - (1 + a^2*x^2)^(5/2)/(a^2*(1 - im*a*x)^3) + (9*im*asinh(a*x))/(2*a^2)]
    @test_int [ℯ^((3*im)*atan(a*x))*x^0, x, 5, -((2*im*(1 + im*a*x)^2)/(a*sqrt(1 + a^2*x^2))) - (3*im*sqrt(1 + a^2*x^2))/a - (3*asinh(a*x))/a]
    @test_int [ℯ^((3*im)*atan(a*x))/x^1, x, 8, (4*im*sqrt(1 + a^2*x^2))/(im + a*x) - im*asinh(a*x) - atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^((3*im)*atan(a*x))/x^2, x, 8, -(sqrt(1 + a^2*x^2)/x) - (4*a*sqrt(1 + a^2*x^2))/(im + a*x) - 3*im*a*atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^((3*im)*atan(a*x))/x^3, x, 12, -(sqrt(1 + a^2*x^2)/(2*x^2)) - (3*im*a*sqrt(1 + a^2*x^2))/x - (4*im*a^2*sqrt(1 + a^2*x^2))/(im + a*x) + (9/2)*a^2*atanh(sqrt(1 + a^2*x^2))]
    @test_int [ℯ^((3*im)*atan(a*x))/x^4, x, 14, -(sqrt(1 + a^2*x^2)/(3*x^3)) - (3*im*a*sqrt(1 + a^2*x^2))/(2*x^2) + (14*a^2*sqrt(1 + a^2*x^2))/(3*x) + (4*a^3*sqrt(1 + a^2*x^2))/(im + a*x) + (11/2)*im*a^3*atanh(sqrt(1 + a^2*x^2))]


    @test_int [ℯ^((4*im)*atan(a*x))*x^3, x, 3, ((12*im)*x)/a^3 - (4*x^2)/a^2 - (((4*im)/3)*x^3)/a + x^4/4 + (4*im)/(a^4*(im + a*x)) + (16*log(im + a*x))/a^4]
    @test_int [ℯ^((4*im)*atan(a*x))*x^2, x, 3, (-8*x)/a^2 - ((2*im)*x^2)/a + x^3/3 - 4/(a^3*(im + a*x)) + ((12*im)*log(im + a*x))/a^3]
    @test_int [ℯ^((4*im)*atan(a*x))*x^1, x, 3, ((-4*im)*x)/a + x^2/2 - (4*im)/(a^2*(im + a*x)) - (8*log(im + a*x))/a^2]
    @test_int [ℯ^((4*im)*atan(a*x))*x^0, x, 3, x + 4/(a*(im + a*x)) - ((4*im)*log(im + a*x))/a]
    @test_int [ℯ^((4*im)*atan(a*x))/x^1, x, 3, (4*im)/(im + a*x) + log(x)]
    @test_int [ℯ^((4*im)*atan(a*x))/x^2, x, 3, -x^(-1) - (4*a)/(im + a*x) + (4*im)*a*log(x) - (4*im)*a*log(im + a*x)]
    @test_int [ℯ^((4*im)*atan(a*x))/x^3, x, 3, -1/(2*x^2) - ((4*im)*a)/x - ((4*im)*a^2)/(im + a*x) - 8*a^2*log(x) + 8*a^2*log(im + a*x)]
    @test_int [ℯ^((4*im)*atan(a*x))/x^4, x, 3, -1/(3*x^3) - ((2*im)*a)/x^2 + (8*a^2)/x + (4*a^3)/(im + a*x) - (12*im)*a^3*log(x) + (12*im)*a^3*log(im + a*x)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [x^3/ℯ^(im*atan(a*x)), x, 5, (x^2*sqrt(1 + a^2*x^2))/(3*a^2) - (im*x^3*sqrt(1 + a^2*x^2))/(4*a) - ((16 - 9*im*a*x)*sqrt(1 + a^2*x^2))/(24*a^4) - (3*im*asinh(a*x))/(8*a^4)]
    @test_int [x^2/ℯ^(im*atan(a*x)), x, 7, (im*sqrt(1 + a^2*x^2))/a^3 + (x*sqrt(1 + a^2*x^2))/(2*a^2) - (im*(1 + a^2*x^2)^(3/2))/(3*a^3) - asinh(a*x)/(2*a^3)]
    @test_int [x^1/ℯ^(im*atan(a*x)), x, 3, ((2 - im*a*x)*sqrt(1 + a^2*x^2))/(2*a^2) + (im*asinh(a*x))/(2*a^2)]
    @test_int [x^0/ℯ^(im*atan(a*x)), x, 3, -((im*sqrt(1 + a^2*x^2))/a) + asinh(a*x)/a]
    @test_int [1/(ℯ^(im*atan(a*x))*x^1), x, 6, (-im)*asinh(a*x) - atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^(im*atan(a*x))*x^2), x, 5, -(sqrt(1 + a^2*x^2)/x) + im*a*atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^(im*atan(a*x))*x^3), x, 6, -(sqrt(1 + a^2*x^2)/(2*x^2)) + (im*a*sqrt(1 + a^2*x^2))/x + (1/2)*a^2*atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^(im*atan(a*x))*x^4), x, 7, -(sqrt(1 + a^2*x^2)/(3*x^3)) + (im*a*sqrt(1 + a^2*x^2))/(2*x^2) + (2*a^2*sqrt(1 + a^2*x^2))/(3*x) - (1/2)*im*a^3*atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^(im*atan(a*x))*x^5), x, 8, -(sqrt(1 + a^2*x^2)/(4*x^4)) + (im*a*sqrt(1 + a^2*x^2))/(3*x^3) + (3*a^2*sqrt(1 + a^2*x^2))/(8*x^2) - (2*im*a^3*sqrt(1 + a^2*x^2))/(3*x) - (3/8)*a^4*atanh(sqrt(1 + a^2*x^2))]


    @test_int [x^3/ℯ^((2*im)*atan(a*x)), x, 3, ((2*im)*x)/a^3 + x^2/a^2 - (((2*im)/3)*x^3)/a - x^4/4 - (2*log(im - a*x))/a^4]
    @test_int [x^2/ℯ^((2*im)*atan(a*x)), x, 3, (2*x)/a^2 - (im*x^2)/a - x^3/3 + ((2*im)*log(im - a*x))/a^3]
    @test_int [x^1/ℯ^((2*im)*atan(a*x)), x, 3, ((-2*im)*x)/a - x^2/2 + (2*log(im - a*x))/a^2]
    @test_int [x^0/ℯ^((2*im)*atan(a*x)), x, 3, -x - ((2*im)*log(im - a*x))/a]
    @test_int [1/(ℯ^((2*im)*atan(a*x))*x^1), x, 3, log(x) - 2*log(im - a*x)]
    @test_int [1/(ℯ^((2*im)*atan(a*x))*x^2), x, 3, -x^(-1) - (2*im)*a*log(x) + (2*im)*a*log(im - a*x)]
    @test_int [1/(ℯ^((2*im)*atan(a*x))*x^3), x, 3, -1/(2*x^2) + ((2*im)*a)/x - 2*a^2*log(x) + 2*a^2*log(im - a*x)]
    @test_int [1/(ℯ^((2*im)*atan(a*x))*x^4), x, 3, -1/(3*x^3) + (im*a)/x^2 + (2*a^2)/x + (2*im)*a^3*log(x) - (2*im)*a^3*log(im - a*x)]


    @test_int [x^3/ℯ^((3*im)*atan(a*x)), x, 14, (1 - im*a*x)^3/(a^4*sqrt(1 + a^2*x^2)) + (27*sqrt(1 + a^2*x^2))/(4*a^4) - (x^2*sqrt(1 + a^2*x^2))/a^2 + (im*x^3*sqrt(1 + a^2*x^2))/(4*a) - (9*im*(2*im + 3*a*x)*sqrt(1 + a^2*x^2))/(8*a^4) + (51*im*asinh(a*x))/(8*a^4)]
    @test_int [x^2/ℯ^((3*im)*atan(a*x)), x, 10, -((im*(1 - im*a*x)^3)/(a^3*sqrt(1 + a^2*x^2))) - (im*(3 - im*a*x)^2*sqrt(1 + a^2*x^2))/(3*a^3) - ((28*im + 3*a*x)*sqrt(1 + a^2*x^2))/(6*a^3) + (11*asinh(a*x))/(2*a^3)]
    @test_int [x^1/ℯ^((3*im)*atan(a*x)), x, 9, -((9*sqrt(1 + a^2*x^2))/(2*a^2)) - (3*(1 + a^2*x^2)^(3/2))/(2*a^2*(1 + im*a*x)) - (1 + a^2*x^2)^(5/2)/(a^2*(1 + im*a*x)^3) - (9*im*asinh(a*x))/(2*a^2)]
    @test_int [x^0/ℯ^((3*im)*atan(a*x)), x, 5, (2*im*(1 - im*a*x)^2)/(a*sqrt(1 + a^2*x^2)) + (3*im*sqrt(1 + a^2*x^2))/a - (3*asinh(a*x))/a]
    @test_int [1/(ℯ^((3*im)*atan(a*x))*x^1), x, 8, (4*im*sqrt(1 + a^2*x^2))/(im - a*x) + im*asinh(a*x) - atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^((3*im)*atan(a*x))*x^2), x, 8, -(sqrt(1 + a^2*x^2)/x) + (4*a*sqrt(1 + a^2*x^2))/(im - a*x) + 3*im*a*atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^((3*im)*atan(a*x))*x^3), x, 12, -(sqrt(1 + a^2*x^2)/(2*x^2)) + (3*im*a*sqrt(1 + a^2*x^2))/x - (4*im*a^2*sqrt(1 + a^2*x^2))/(im - a*x) + (9/2)*a^2*atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^((3*im)*atan(a*x))*x^4), x, 14, -(sqrt(1 + a^2*x^2)/(3*x^3)) + (3*im*a*sqrt(1 + a^2*x^2))/(2*x^2) + (14*a^2*sqrt(1 + a^2*x^2))/(3*x) - (4*a^3*sqrt(1 + a^2*x^2))/(im - a*x) - (11/2)*im*a^3*atanh(sqrt(1 + a^2*x^2))]
    @test_int [1/(ℯ^((3*im)*atan(a*x))*x^5), x, 19, -(sqrt(1 + a^2*x^2)/(4*x^4)) + (im*a*sqrt(1 + a^2*x^2))/x^3 + (19*a^2*sqrt(1 + a^2*x^2))/(8*x^2) - (6*im*a^3*sqrt(1 + a^2*x^2))/x + (4*im*a^4*sqrt(1 + a^2*x^2))/(im - a*x) - (51/8)*a^4*atanh(sqrt(1 + a^2*x^2))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*ℯ^(n/2*im*atan(a*x))=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [ℯ^((im/2)*atan(a*x))*x^2, x, 15, (((-3*im)/8)*(1 - im*a*x)^(3/4)*(1 + im*a*x)^(1/4))/a^3 - ((im/12)*(1 - im*a*x)^(3/4)*(1 + im*a*x)^(5/4))/a^3 + (x*(1 - im*a*x)^(3/4)*(1 + im*a*x)^(5/4))/(3*a^2) + (((3*im)/8)*atan(1 - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a^3) - (((3*im)/8)*atan(1 + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a^3) - (((3*im)/16)*log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a^3) + (((3*im)/16)*log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a^3)]
    @test_int [ℯ^((im/2)*atan(a*x))*x^1, x, 14, ((1 - im*a*x)^(3/4)*(1 + im*a*x)^(1/4))/(4*a^2) + ((1 - im*a*x)^(3/4)*(1 + im*a*x)^(5/4))/(2*a^2) - atan(1 - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4))/(4*sqrt(2)*a^2) + atan(1 + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4))/(4*sqrt(2)*a^2) + log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4))/(8*sqrt(2)*a^2) - log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4))/(8*sqrt(2)*a^2)]
    @test_int [ℯ^((im/2)*atan(a*x)), x, 13, (im*(1 - im*a*x)^(3/4)*(1 + im*a*x)^(1/4))/a - (im*atan(1 - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a) + (im*atan(1 + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a) + ((im/2)*log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a) - ((im/2)*log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)))/(sqrt(2)*a)]
    @test_int [ℯ^((im/2)*atan(a*x))/x^1, x, 17, -2*atan((1 + im*a*x)^(1/4)/(1 - im*a*x)^(1/4)) + sqrt(2)*atan(1 - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)) - sqrt(2)*atan(1 + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4)) - 2*atanh((1 + im*a*x)^(1/4)/(1 - im*a*x)^(1/4)) - log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) - (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4))/sqrt(2) + log(1 + sqrt(1 - im*a*x)/sqrt(1 + im*a*x) + (sqrt(2)*(1 - im*a*x)^(1/4))/(1 + im*a*x)^(1/4))/sqrt(2)]
    @test_int [ℯ^((im/2)*atan(a*x))/x^2, x, 6, -(((1 - im*a*x)^(3/4)*(1 + im*a*x)^(1/4))/x) - im*a*atan((1 + im*a*x)^(1/4)/(1 - im*a*x)^(1/4)) - im*a*atanh((1 + im*a*x)^(1/4)/(1 - im*a*x)^(1/4))]
    @test_int [ℯ^((im/2)*atan(a*x))/x^3, x, 7, -((im*a*(1 - im*a*x)^(3/4)*(1 + im*a*x)^(1/4))/(4*x)) - ((1 - im*a*x)^(3/4)*(1 + im*a*x)^(5/4))/(2*x^2) + (1/4)*a^2*atan((1 + im*a*x)^(1/4)/(1 - im*a*x)^(1/4)) + (1/4)*a^2*atanh((1 + im*a*x)^(1/4)/(1 - im*a*x)^(1/4))]
